import { useState } from "react";
const Dashboard = () => {
  const [isOnline, setIsOnline] = useState(true);
  const changName = () => {
    setIsOnline(!isOnline);
  };
  return (
    <>
      <h1>Dashboard</h1>
      <div class="dots" onclick="this.classList.toggle('active');">
        <div class="dot"></div>
        <div class="dot"></div>
        <div class="shadow cut"></div>
        <div class="container cut">
          <div class="drop cut2"></div>
        </div>
        <div class="list">
          <ul>
            <li>Mark as read</li>
            <li>Flag as important</li>
            <li>Save for later</li>
            <li>Move to trash</li>
            <li>Mark as spam</li>
          </ul>
        </div>
        <div class="dot"></div>
      </div>
      <div
        class="cursor"
        className={`${isOnline ? "offline2" : " online2"}`}
        onclick="document.querySelector('.dots').classList.toggle('active');"
      ></div>
    </>
  );
};

export default Dashboard;
